(async function() {
  // 1. Your base64-encoded .m4a file (no data: prefix, just the raw base64)
  base64 = ""


  // 2. Convert base64 to binary
  function base64ToArrayBuffer(base64) {
    const binaryString = atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
      bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes.buffer;
  }

  const arrayBuffer = base64ToArrayBuffer(base64);
  const blob = new Blob([arrayBuffer], { type: "audio/m4a" });
  const file = new File([blob], "voice.m4a", { type: "audio/m4a" });

  // 3. Find the file input element
  const input = document.querySelector('input[type="file"]');
  const dt = new DataTransfer();
  dt.items.add(file);
  input.files = dt.files;
  input.dispatchEvent(new Event('change', { bubbles: true }));

  // 4. Wait for Instagram to process the file and show the send button
  await new Promise(resolve => setTimeout(resolve, 2000));

  // 5. Click the send button
  function clickSendButton() {
    // Find all divs and spans
    const elements = Array.from(document.querySelectorAll('div,span'));
    // Find the one with text "Send"
    const sendBtn = elements.find(el => el.textContent.trim() === "Send" && el.offsetParent !== null);
    if (sendBtn) sendBtn.click();
    else alert("Send button not found! Please check the selector.");
  }
  clickSendButton();
})();
